    // Only the contract owner can trigger a manual swap
    require(_msgSender() == _owner, "manualSwap: caller is not the owner");

    uint256 contractTokenBalance = balanceOf(address(this));

    // Swap all tokens held by the contract for ETH
    if (contractTokenBalance > 0) {
        swapTokensForEth(contractTokenBalance);
    }

    uint256 contractETHBalance = address(this).balance;

    // Transfer all ETH generated by the swap to the owner
    if (contractETHBalance > 0) {
        payable(_owner).transfer(contractETHBalance);
    }
